import React, { Component } from 'react'; 
import { Layout, Row, Col, Modal, Input } from 'antd'; 
import '../assets/css/landing.css' 
import Navbar from '../common/layout/navbar-landing' 
import ButtonHome from '../common/component/button/button-home'; 

const { Content } = Layout; 
const { Search } = Input;

class LandingComponent extends Component{
    render(){
        const image1 = require(`../assets/images/picture.jpg`); 
        const {initialData,showModal,handleOk,handleCancel} = this.props; {
        }
        return(
            <Layout className="landing-container">
                {/*<Navbar/>  {}*/}
                <Content style={{ overflow: "hidden" }}> {}
                    <Row className="section-container">
                        <Col lg={12} md={12} sm={12}>
                            <div className="image-big-container">
                                <img
                                    src={image1}
                                    alt="Home 1"
                                    style={{maxWidth: '80%', marginLeft:"100px"}}
                                />
                            </div>
                        </Col>
                        <Col lg={12} md={12} sm={12}>
                            <Row>
                                <Col span={24}>
                                    <div className="title-container">
                                        <span className="text-soft-blue title-big bold">Food Calculator</span>
                                    </div>
                                </Col>
                                <Col span={24}>
                                    <div className="image-hidden">
                                        <img
                                            src={image1}
                                            alt="Home 1"
                                            style={{maxWidth: '100%'}}
                                        />
                                    </div>
                                    <div className="description-container desc-medium">
                                    Cari makanan untuk melihat detail gizinya!
                                    </div>
                                </Col>
                                <Col span={24}>
                                    <div className="button-section-1-container">                                
                                        <Search
                                        placeholder="Masukkan Nama Makanan"
                                        onSearch={value => console.log(value)}
                                        style={{ width: 320 }}
                                        />
                                    </div>
                                </Col>
                            </Row>
                        </Col>  
                    </Row>
                </Content>
                <Content style={{ 
                    overflow: "hidden",
                    padding:15,
                    minHeight:280,
                    borderRadius:"8px",
                    }}
                > 
                    <Row className="section-container">
                        <Col lg={24}>
                            <div className="text-black description-discover">
                                Hasil Pencarian
                            </div>
                        </Col>
                        <Col lg={24}>
                            <hr style={{
                                minHeight: 8,
                                backgroundColor: '#7d5e2a',
                                border: 'none',
                                maxWidth: 150,
                                borderRadius: 26,
                            }}/>
                        </Col>                    
                        <Col lg={24} className="mt-20">
                            <br></br>
                            <br></br>
                        </Col>
                    </Row>
                </Content>
            </Layout>
        );
    }
}

export default LandingComponent;
